import React, { useEffect, useState } from "react";
import "./App.css";
import { RetellWebClient } from "retell-client-js-sdk";
import { Telephone, TelephoneX } from 'react-bootstrap-icons';
import '@fontsource/raleway';

const agentId = "agent_f7fb4bf17b19155224cbc6f4f1";
const retellWebClient = new RetellWebClient();

const App = () => {
  const [isCalling, setIsCalling] = useState(false);
  const [isAI, setIsAI] = useState(false);
  const [listening, setListening] = useState(false);
  const [hasAgentStarted, setHasAgentStarted] = useState(false);

  useEffect(() => {
    // Handle Retell Events
    retellWebClient.on("agent_start_talking", () => {
      console.log("Agent started talking...");
      setHasAgentStarted(true);
      setIsAI(true);
      setListening(false);
    });

    retellWebClient.on("agent_stop_talking", () => {
      console.log("Agent stopped talking.");
      setIsAI(false);
      // Ready to listen but only when user presses space
    });

    retellWebClient.on("user_start_talking", () => {
      console.log("User started talking...");
    });

    retellWebClient.on("user_stop_talking", () => {
      console.log("User stopped talking.");
    });

    retellWebClient.on("transcript", (data) => {
      console.log("Transcript received: ", data);
    });

    // Push-to-talk: Spacebar handlers
    const handleKeyDown = async (e) => {
      if (e.code === "Space" && !isAI && !listening && isCalling) {
        try {
          console.log("Space pressed → Start sending user audio");
          await retellWebClient.startUserAudio();
          setListening(true);
        } catch (err) {
          console.error("Error starting user audio:", err);
        }
      }
    };

    const handleKeyUp = async (e) => {
      if (e.code === "Space" && listening) {
        try {
          console.log("Space released → Stop sending user audio");
          await retellWebClient.stopUserAudio();
          setListening(false);
        } catch (err) {
          console.error("Error stopping user audio:", err);
        }
      }
    };

    window.addEventListener("keydown", handleKeyDown);
    window.addEventListener("keyup", handleKeyUp);

    return () => {
      window.removeEventListener("keydown", handleKeyDown);
      window.removeEventListener("keyup", handleKeyUp);
    };
  }, [isAI, listening, isCalling]);

  // Start / Stop the conversation (calls)
  const toggleConversation = async () => {
    if (isCalling) {
      console.log("Stopping call...");
      retellWebClient.stopCall();
      setIsCalling(false);
      setIsAI(false);
      setListening(false);
    } else {
      console.log("Starting call...");
      const registerCallResponse = await registerCall(agentId);

      if (registerCallResponse.access_token) {
        retellWebClient
          .startCall({
            accessToken: registerCallResponse.access_token,
          })
          .then(() => {
            console.log("Call started successfully.");
            setIsCalling(true);
            setIsAI(true);
            setListening(false);
          })
          .catch((error) => {
            console.error("Error starting call:", error);
          });
      } else {
        console.error("No access token received");
      }
    }
  };

  // Register the call with your backend
  async function registerCall(agentId) {
    try {
      const response = await fetch("https://al-wathba-backend.onrender.com/create-web-call", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify({
          agent_id: agentId,
        }),
      });

      const data = await response.json();
      return data;
    } catch (err) {
      console.error("Error in registerCall:", err);
      throw new Error(err);
    }
  }

  return (
    <div className="App">
      <header className="App-header">
        <h2 style={{ marginBottom: '50px', fontFamily: 'Raleway, sans-serif' }}>
          AL Wathba Demo - Hindi
        </h2>

        {/* Audio spectrum and visual feedback */}
        <div className="pulse-container">
          <div className={`audio-spectrum ${isAI ? 'active' : ''}`}></div>

          <div className={`pulse-animation ${isAI ? 'animate' : ''}`}>
            {isAI && (
              <div className="equalizer">
                <div className="equalizer-bar"></div>
                <div className="equalizer-bar"></div>
                <div className="equalizer-bar"></div>
                <div className="equalizer-bar"></div>
                <div className="equalizer-bar"></div>
              </div>
            )}

            <img
              src="/images/latin-man-avatar-people-04feb2024__9_-ID32942-2000x2000-removebg-preview.png"
              alt="AI"
              className="circle-image"
            />
          </div>
        </div>

        {/* Listening status */}
        {hasAgentStarted && !isAI && listening && (
          <p className="listening-text">Listening...</p>
        )}

        {/* Start/Stop Button */}
        <button
          onClick={toggleConversation}
          className={`call-button ${isCalling ? "stop" : "start"}`}
        >
          {isCalling ? <TelephoneX size={40} /> : <Telephone size={40} />}
        </button>

        {/* Instructions */}
        {isCalling && (
          <p style={{ marginTop: '20px' }}>
            Press and hold <strong>Spacebar</strong> to talk!
          </p>
        )}
      </header>
    </div>
  );
};

export default App;
